      (function () {
          var codeMirroSetting = {},
              codeType = '<?=$codeType;?>';

          switch (codeType){
              case 'twig':
                  codeMirroSetting = {
                      mode : "text/html",
                      lineNumbers : true,
                      profile: 'xhtml',
                      lineWrapping: true,
                      extraKeys: {"Ctrl-Q": function(cm){ cm.foldCode(cm.getCursor()); }},
                      foldGutter: true,
                      gutters: ["CodeMirror-linenumbers", "CodeMirror-foldgutter"],
                      onKeyEvent: function(i, e) {
                          / Hook into F11
                          if ((e.keyCode == 122 || e.keyCode == 27) && e.type == 'keydown') {
                              e.stop();
                              return toggleFullscreenEditing();
                          }
                      },
                  };
                  break;
              case 'css':
                  codeMirroSetting = {
                      mode : "text/css",
                      lineNumbers : true,
                      lineWrapping: true,
                      extraKeys: {"Ctrl-Q": function(cm){ cm.foldCode(cm.getCursor()); }},
                      foldGutter: true,
                      gutters: ["CodeMirror-linenumbers", "CodeMirror-foldgutter"],
                      onKeyEvent: function(i, e) {
                          / Hook into F11
                          if ((e.keyCode == 122 || e.keyCode == 27) && e.type == 'keydown') {
                              e.stop();
                              return toggleFullscreenEditing();
                          }
                      },
                  };
                  break;
              case 'js':
                  codeMirroSetting = {
                      mode : "text/javascript",
                      lineNumbers : true,
                      lineWrapping: true,
                      extraKeys: {"Ctrl-Q": function(cm){ cm.foldCode(cm.getCursor()); }},
                      foldGutter: true,
                      gutters: ["CodeMirror-linenumbers", "CodeMirror-foldgutter"],
                      onKeyEvent: function(i, e) {
                          / Hook into F11
                          if ((e.keyCode == 122 || e.keyCode == 27) && e.type == 'keydown') {
                              e.stop();
                              return toggleFullscreenEditing();
                          }
                      },
                  };
                  break;
              default:
                  codeMirroSetting = {
                      lineNumbers : true,
                      lineWrapping: true,
                      foldGutter: true,
                      gutters: ["CodeMirror-linenumbers", "CodeMirror-foldgutter"],
                      onKeyEvent: function(i, e) {
                          / Hook into F11
                          if ((e.keyCode == 122 || e.keyCode == 27) && e.type == 'keydown') {
                              e.stop();
                              return toggleFullscreenEditing();
                          }
                      },
                  };
                  break;
          }

          CodeMirror.fromTextArea(document.getElementById("code"), codeMirroSetting);

          function toggleFullscreenEditing()
          {
              var editorDiv = $('.CodeMirror-scroll');
              if (!editorDiv.hasClass('fullscreen')) {
                  toggleFullscreenEditing.beforeFullscreen = { height: editorDiv.height(), width: editorDiv.width() }
                  editorDiv.addClass('fullscreen');
                  editorDiv.height('100%');
                  editorDiv.width('100%');
                  editor.refresh();
                  editorDiv.append('<div class="fullscreen-blockFull"><a href="#" class="btn btn-sm btn-default fullScreenButtonOff"><span class="fa fa-compress" style="font-size: 18px; position: absolute; left: 6px; top: 4px;"></span></a> </div>')
              }
              else {
                  editorDiv.removeClass('fullscreen');
                  editorDiv.height(toggleFullscreenEditing.beforeFullscreen.height);
                  editorDiv.width(toggleFullscreenEditing.beforeFullscreen.width);
                  editor.refresh();
                  $('.fullscreen-blockFull').remove();
              }
          }

          $(document).on('click', '.fullScreenButton', function (e) {
              toggleFullscreenEditing();
          });
          $(document).on('click', '.fullScreenButtonOff', function (e) {
              toggleFullscreenEditing();
          });
          $(document).keyup(function(e) {
              if (e.keyCode == 27 && $('.fullscreen').length >= 1) {
                   toggleFullscreenEditing();
              }
          });
      })();
      <?php endif; ?>
  </script>
<script type="text/javascript">
  var degree = 1800;
var clicks = 0;

$(document).ready(function(){
  $('#spin').click(function(){
    clicks ++;
    var newDegree = degree*clicks;
    var extraDegree = Math.floor(Math.random() * (360 - 1 + 1)) + 1;
    totalDegree = newDegree+extraDegree;
    $('#wheel .sec').each(function(){
      var t = $(this);
      var noY = 0;
      var c = 0;
      var n = 700;  
      var interval = setInterval(function () {
        c++;        
        if (c === n) { 
          clearInterval(interval);        
        } 

        var aoY = t.offset().top;
        $("#txt").html(aoY);
        
        if(aoY < 23.89){
          console.log('<<<<<<<<');
          $('#spin').addClass('spin');
          setTimeout(function () { 
            $('#spin').removeClass('spin');
          }, 100);  
        }
      }, 10);
      
      $('#inner-wheel').css({
        'transform' : 'rotate(' + totalDegree + 'deg)'      
      });
      noY = t.offset().top;
    });
  }); 
});
</script>


